import React, { Component } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser, setCurrentUser } from "../actions/authAutentications";
import Button from "react-bootstrap/Button";
import LockOpenIcon from "@material-ui/icons/LockOpen";
import LockIcon from "@material-ui/icons/Lock";
import BuildIcon from "@material-ui/icons/Build";
import { Link, withRouter } from "react-router-dom";
import "../App.css";
import Mappa from "../../src/componenti/googlemap/mappa";

class GestioneCorsa extends Component {
  constructor(props) {
    super(props);
  }

  onLogoutClick = (e) => {
    e.preventDefault();
    this.props.logoutUser();
  };

  render() {
    const { user } = this.props.auth;

    if (user.ruolo === "Admin" || user.ruolo === "Addetto") {
      return <div></div>;
    } else if (user.ruolo === "Cliente" || user.ruolo === "Autista") {
      return (
        <Container fluid>
          <Row className="justify-content-md-center">
            <Mappa style={{ zIndex: "0" }} />
          </Row>
          <Row className="justify-content-md-center">
            <Col sm={6}>
              <h1
                style={{
                  color: "#010101",
                  textAlign: "center",
                  fontWeight: "bolder",
                  fontSize: "30px",
                }}
              >
                Parcheggio Partenza:{" "}
                {localStorage.getItem("parcheggio_partenza")}
              </h1>
              {parcheggio.length === 0 ? "Non ci sono parcheggi" : PL}
            </Col>
            <Col sm={6}>
              {" "}
              <h1
                style={{
                  color: "#010101",
                  textAlign: "center",
                  fontWeight: "bolder",
                  fontSize: "30px",
                }}
              >
                Parcheggio Destinazione:{" "}
                {localStorage.getItem("parcheggio_destinazione")}
              </h1>
              <h1
                style={{
                  color: "#010101",
                  textAlign: "center",
                  fontWeight: "bolder",
                  fontSize: "30px",
                }}
                id="parcheggiodestinazione"
              ></h1>
              {parcheggio.length === 0 ? "Non ci sono parcheggi" : PL2}
            </Col>
          </Row>
          <Row className="justify-content-md-center">
            <Col sm={4}>
              <button
                class="btn btn-primary btn-lg btn-block bottone"
                onClick={() => this.registraPreotazione()}
              >
                Prosegui
              </button>
            </Col>
          </Row>
        </Container>
      );
    }
  }
}
GestioneCorsa.propTypes = {
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
  auth: state.auth,
});

export default connect(mapStateToProps, { logoutUser })(GestioneCorsa);
